import React from "react";
import "./styles.css";
// import { BrowserRouter as Router, Route } from "react-router-dom";
//?======COMPONENTS==========================================
//  import Header from "./components/header.js";
// import Intro from "./components/intro.js";
// import About from "./components/about.js";
// import Selection from "./components/selection.js";
// import Contact from "./components/contact.js";

//*=======APP.JS===========================
function App() {
  return (
    <div className="App">
      <div className="header">
        <h1>
          QUIETLY <br /> THRIVING
        </h1>
        <h3>WITH NATASCHA HENRIKSEN</h3>
      </div>
      <div className="links">
        <p>If you are interested in knowing more on how to work with me, you can book a first free 30 minutes call. I can't wait to meet you.</p>
        <a
          className="click"
          href="https://calendly.com/nataschavejenhenriksen/30min?month=2021-03&fbclid=IwAR1WnZBK5YsZ0-8hFcCdUkNbKCEExosnTmnahbDd6RZ1PuiO9zHu-PpKznA"
          class="button"
        >
          Book
        </a>
        <p>Link til Facebook Gruppe</p>
        <a
          className="click"
          href="https://www.facebook.com/groups/quietlythriving"
          class="button"
        >
          Facebook
        </a>
      </div>
      <div className="info">
        <p>Join the Quietly Thriving Community. It’s a safe space where you can express yourself authentically and connect with other like-minded introverted women who are on a journey of growth and self-discovery, as well as self-acceptance. 
Introversion is a preference, not a weakness! It’s time to re-write the narrative about introversion. Being quiet, has nothing to do with what you can or can’t accomplish. You just have to do it in a way that fits YOU. So let’s re-write and create the recipe together. 
This is a community for introverted women to support and encourage each other. 
It’s for you who: 
- are driven and passionate
- are tired of being quiet 
- are on a mission to become a better version of yourself, not compromising on who you are
- have a dream that you’re ready to pursue
- who have an entrepreneur hiding inside you
- are seeking to authentically connect with other women you can truly resonate with 
In this space you will find: 
- Weekly check-ins
- Weekly debates on specific topics
- Free live workshops
- Updates and discounts on new offerings
- Connection and celebration with introverted women on a similar journey</p>
      </div>
    </div>
  );
}

export default App;

